query:
fragment MenuErrorFragment on MenuError {
  code
  field
  __typename
}

fragment MenuItemFragment on MenuItem {
  category {
    id
    name
    __typename
  }
  collection {
    id
    name
    __typename
  }
  id
  level
  name
  page {
    id
    title
    __typename
  }
  url
  __typename
}

fragment MenuItemNestedFragment on MenuItem {
  ...MenuItemFragment
  children {
    ...MenuItemFragment
    children {
      ...MenuItemFragment
      children {
        ...MenuItemFragment
        children {
          ...MenuItemFragment
          children {
            ...MenuItemFragment
            children {
              ...MenuItemFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

mutation MenuItemCreate($input: MenuItemCreateInput!) {
  menuItemCreate(input: $input) {
    errors: menuErrors {
      ...MenuErrorFragment
      __typename
    }
    menuItem {
      menu {
        id
        items {
          ...MenuItemNestedFragment
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
